    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            if (pic_name[i] != "jdt_y") {
                this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
            }
        }
        var shardsImg = new Image();
        shardsImg.onload = () => {
            this.textures.addSpriteSheet('jdt_y', shardsImg, {
                frameWidth: 1000,
                frameHeight: 2500/6
            });
        };
        shardsImg.src = assets.jdt_y

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }
    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

