class level1 extends playGame {
    constructor() {
        super("level1");
    }

    create() {
        this.resize();
        window.addEventListener("resize", this.resize, false);
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        var bg = this.add.image(game.config.width/2, game.config.height/2, 'bg').setAngle(90)

        var json = {
            letter:['t','e','y','a'],
            answer:['eat']
        }
        this.clickWord(json,'level2')
        // this.JDT()
    }
    update() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
    }

}
