class end extends playGame {
    constructor() {
        super("end");
    }

    create() {
        this.resize();
        window.addEventListener("resize", this.resize, false);
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        var this_ = this
        this.star('bigstar')
        this.star('star_1')
        var bg = this.add.image(game.config.width/2, game.config.height/2, 'bg').setAngle(90)
        var road = this.add.image(850,500,'road').setAngle(90)
        var star_m =  this.add.image(281,500,'star_m').setAngle(90).setAlpha(0).setScale(30) 
        var star_m2 = this.add.image(281,350,'star_m').setAngle(90).setAlpha(0).setScale(30)
        var star_m3 = this.add.image(281,650,'star_m').setAngle(90).setAlpha(0).setScale(30)
        var button = this.add.image(-300,500,'continue_button').setAngle(90).setInteractive().on('pointerdown',function name(params) {
            landingPage()
        })
        this.tweens.add({
            targets:road,
            x:450,
            duration:800,
            onComplete:()=>{
                this.tweens.add({
                    targets:star_m2,
                    alpha:1,
                    scaleX:1,
                    scaleY:1,
                    duration:300
                })
                this.tweens.add({
                    targets:star_m,
                    delay:300,
                    alpha:1,
                    scaleX:1,
                    scaleY:1,
                    duration:300
                })
                this.tweens.add({
                    targets:star_m3,
                    delay:600,
                    alpha:1,
                    scaleX:1,
                    scaleY:1,
                    duration:300
                })
            }
        })
        this.tweens.add({
            targets:button,
            x:100,
            duration:800,
            onComplete:()=>{
                this.tweens.add({
                    targets:button,
                    scaleX:1.05,
                    scaleY:1.05,
                    yoyo:true,
                    repeat:-1,
                    duration:300,
                })
            }
        })
    }

    //星星特效
    star(name) {
        var particles = this.add.particles(name).setDepth(5)
        var emiter = particles.createEmitter({
            "active": true,
            "visible": true,
            "collideBottom": true,
            "collideLeft": true,
            "collideRight": true,
            "collideTop": true,
            "on": true,
            "particleBringToTop": true,
            "radial": true,
            "frequency": 200,
            "gravityX": 0,
            "gravityY": 0,
            "maxParticles": 0,
            "timeScale": 1,
            "blendMode": 0,
            "accelerationX": 0,
            "accelerationY": 0,
            "alpha": {
                "ease": "Linear",
                "start": 1,
                "end": 0
            },
            "angle": {
                "min": 0,
                "max": 360,
                "ease": "Linear"
            },
            "bounce": 0,
            "delay": 0,
            "lifespan": 500,
            "maxVelocityX": 10000,
            "maxVelocityY": 10000,
            "moveToX": 0,
            "moveToY": 0,
            "quantity": {
                "ease": "Linear",
                "start": 1,
                "end": 1
            },
            "rotate": 0,
            "scale": 0.6,
            "speed": {
                "ease": "Linear",
                "start": 5,
                "end": 5
            },
            "x": 375,
            "y": 265,
            "tint": [16777215],
            "emitZone": {
                "source": new Phaser.Geom.Rectangle(-280, -300, game.config.width, game.config.height),
                "type": "random"
            },
            "deathZone": {
                "source": new Phaser.Geom.Circle(300, 0, 60),
                "type": "onEnter"
            }
        })
        // setTimeout(() => {new Phaser.Geom.Rectangle(-280, -300, game.config.width, game.config.height)
        //     emiter.visible = 0
        // }, 1000);
        return emiter
    }    

}

